import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import './NavBer.css'
import logo from '../images/logo.png'
import logo2 from '../images/logo2.png'
import Badge from 'react-bootstrap/Badge'




class NavBer1 extends Component {
    render() {
        return (
                 
   <div className="Navbar1">
  <Navbar bg="light" variant="light">

  <a href = "./home" > 
         <img src ={logo2} alt="logo"
          style={{
            width:"150px",
            height:"100px",
          }}/> 
      </a>

      <Nav className="Number">   
        <h2 style={{
          padding:"11px ",
          border:"15px solid #fff"
        }}>Hot Line</h2>
        <h4>333<br/>National Call Center</h4>
        <h4>16263<br/>Health windows</h4>
        <h4>09611677777<br/>Specialist Health Line</h4>
        <h4>10655<br/>IEDCR</h4>
        <h4>109<br/>National helpline</h4>

    </Nav>   


  </Navbar>

  <div/>
 </div>
        );
    }
}

export default NavBer1;
